        <div className="col-6 col-12-sm fotoCol ">
          <img
            className="fotoDavid"
            src={"fotoDavid"}
            alt="Foto David"
          />
        </div>
        <div className="col-6 col-12-sm textCol">
          <h1 className="textCol">Welcome!</h1>
          <h3 className="textColSecond">my Name is David Zoike</h3>
        </div>
      </div>
    </div>
  );
}

export default Heading;
